A situação emergencial aqui configurada evidencia-se pelo risco concreto de interrupção de serviços essenciais e pelos seguintes impactos:
• Preservação das estruturas públicas já executadas (bases e sub-bases), com risco de deterioração e desperdício de recursos públicos;
• Continuidade das atividades essenciais vinculadas à infraestrutura viária municipal;
• Segurança e integridade dos munícipes, ante o potencial aumento de acidentes decorrentes de vias danificadas;
• Proteção ao interesse público primário, sob os enfoques da mobilidade urbana, segurança viária, economicidade e preservação do patrimônio público.
	A interrupção desses serviços implica como descrito, riscos concretos à trafegabilidade, ao atendimento de demandas operacionais urgentes e à preservação das obras concluídas ou em andamento, sobretudo nas regiões onde já houve abertura de vias, regularização de subleito e execução de base e sub-base, atividades que dependem de fornecimento contínuo de concreto betuminoso usinado a quente (CBUQ). A excepcionalidade aqui reconhecida é corroborada pelo entendimento do próprio Tribunal de Contas do Estado do Rio de Janeiro, que, em situações análogas, admitiu que, mesmo diante da suspensão de certames principais, podem e devem ser adotadas “medidas complementares imprescindíveis à garantia da segurança da população”, a fim de evitar prejuízos coletivos, danos ao erário e descontinuidade de serviços públicos de natureza essencial. A contratação pretendida terá vigência estritamente limitada ao período necessário para conclusão do novo processo licitatório definitivo.
	Desse modo, a adoção do regime emergencial mostra-se medida adequada, proporcional e indispensável para preservar o interesse público, assegurar a prestação ininterrupta dos serviços essenciais e evitar danos à mobilidade urbana, à segurança viária e à integridade da infraestrutura municipal.

O objeto da contratação está previsto no Plano de Contratações Anual 2025, nos termos do Decreto estadual nº 67.689, de 3 de maio de 2023, conforme detalhamento a seguir:
